import React from "react";
import "./Sidebar.css";
import { Icon } from "web3uikit";

const Sidebar = () => {
  return (
    <>
      <div className="siderContent">
        <div className="menu">
          <Icon fill="#ffffff" size={33} svg="twitter" />
        </div>
      </div>
    </>
  );
};

export default Sidebar;
